description: "Hardly visible on a bed of moss were these thin sculptured stalks with smooth club-shaped tips. The whole fruiting body was about 30 mm tall including the 15 mm club-shaped fertile tips.\r\nSpotted on moss beds along walking track - Churchill National Park . There were several of these in a moist patch of moss. "
